import styled from "styled-components";

export const Wrapper = styled.div`
  background: cyan;
  display: grid;
  grid-template-columns: repeat(4, 175px);
  grid-gap: 10px;
  justify-content: center;
`;

export const Content = styled.div`
  display: block;
`;
